import React, { Component } from 'react'
import { Grommet, Stack, Text, Box, Nav, Anchor } from 'grommet';
import { Home, Notification, ChatOption } from 'grommet-icons';
import Terminal from 'react-console-emulator'

const commands = {
  echo: {
    description: 'Echo a passed string.',
    usage: 'echo <string>',
    fn: function ()
    {
      return `${Array.from(arguments).join(' ')}`
    }
  }
}

export default class App extends Component
{
  render ()
  {
    return (
      <Grommet themeMode="dark" full>
        <Stack anchor="center" fill>
          <Terminal
            contentStyle={{ 'overflow-x': 'hidden', 'word-wrap': 'break-word' }}
            style={{ minHeight: '100%', minWidth: '100%', borderRadius: '0' }}
            commands={commands}
            promptLabel={'> '}
          />
          <Box pad="medium" border={{ color: 'brand', size: 'large', style: 'double', side: 'horizontal' }}>
            <Text size='xxlarge' color="status-critical" textAlign='center' pad='small' margin='small'>
              Kyle Martin
              <p />
              Computer Engineer
            </Text>
            <Nav direction="row" pad="medium">
              <Anchor icon={<Home />} hoverIndicator />
              <Anchor icon={<Notification />} hoverIndicator />
              <Anchor icon={<ChatOption />} hoverIndicator />
            </Nav>
          </Box>
        </Stack>

      </Grommet >
    )
  }
}
